String = 13500,Si Binh Thuyet Minh
String = 13501,Than dao binh, bo binh loai, khac cung binh, thuong binh, pha ky binh. Cong phong kiem bi, tha huu co hoi phat khoi khong khi thuan.
String = 13502,Than kiem binh, bo binh loai, khac cung binh, thuong binh, pha ky binh. Thi nhat chung uu tu dich can chien binh chung, cong kich phi thuong cao, cong kich thanh truong hao, dan phong ngu ngan de.
String = 13503,Cuong cung binh, vo tuong khac tinh. Cung binh loai, khac ky binh, bi ky tha can chien binh khac, thi vien trinh phao xa binh chung, tai chien trang thuong huu co hoi phat xa dac thu dich “Hoa tien�?
String = 13504,Tien dang doanh thi Vien Thieu quan trung dac thu binh chung, phoi huu vien trinh da kich dich cung no, dong thoi huu giac cuong can chien nang luc, doi bach ma nghia tong huu canh cao sat thuong luc.
String = 13505,Trung nguyen thu khach, bo binh loai, tien ky phi thuong cuong dai, tuy nhien cong kich luc giac de, dan ung huu giac nhat ban si binh canh cao dich vo khi thuc luyen do, xuat thu khoai, hanh dong khoai, tai chien trang thuong hoan huu an hinh nang luc, dan phong de.
String = 13506,Dai kich si, thuong binh loai, khac ky binh, bi bo binh loai khac. Thong soai thi tu thu, khuc nghia, truong cap, thi vien thieu bo doi trung dich tinh anh bo doi, xuyen thu cong kich, huu co hoi phat dong “Hoanh tao�?cong kich, dong thoi sat thuong tien phuong nhat bai, toi da tam danh dich quan.
String = 13507,Than tien thu, cung binh loai, tong thi tien tang tai am xu cap dich nhan di xuat ky bat y dich thau tap, dong truong cung binh phao xa, y nhien thi doi pho vo tuong dich sat thu.
String = 13508,No binh, cung binh loai, cu huu ngan cao dich xa toc, xa trinh. Tai chien trang thuong huu co hoi phat xa cuong luc dich “Thau giap tien”， nang cu quan xuyen toi da tam danh dich quan.
String = 13509,Phu ky binh, ky binh loai, khac bo binh, bi thuong binh, cung tien thu khac. Di dong toc do khoai, dong thoi cap dich nhan tan loi ban da kich toc do.
String = 13510,Dai lieu thiet ky tinh chat dong phu ky binh, ung huu giac cao dich di dong toc do. Tai chien trang thuong hoan huu co hoi thi trien trong dap, huu giac cao phong ngu hoa cong kich.
String = 13511,Dang giap binh, bo binh loai, khac thuong binh, cung binh. Phoi bi khong khi thuan bai dich dang giap binh doi dich phuong cong kich da huu nhat dinh trinh do dich de khang luc, kha thi xac vo phap ung pho quan xuyen luc giac cuong kinh dich no binh tien thi.
String = 13512,Tay ha yeu thu su, dac thu binh loai. Cu huu cong kich thoi hap thu dich phuong sinh menh, dong thoi tuong sat tu dan vi chuyen hoa vi ky phuong thi binh.
String = 13513,Cam quan, bo binh loai, di dong toc do hoan man binh chung, nang cu can cu nhuc bac. Kha su dung “Hoanh tao�?cong kich nhat bai toi da tam ca si binh
String = 13514,Dong hai nu yeu, dac thu binh chung, di toc, cong toc, do thi thu khuat nhat chi, doi dai da so binh chung cu huu nhat kich tat trung dich nang luc. Cu pha vu nuong hoa ca co, cam quan.
String = 13515,Manh ho binh, ky binh loai, chuc vu dac hoa dich ky lao ho dich binh chung, kha lenh dich phuong toa ky dam han, tai doi thuong ky tha ky binh da huu nhat dinh uu the, dan cu pha ca co hoa vu co di cap cung no thu hoa thuong binh.
String = 13516,Nam man ky thi ky binh dich nhat chung, tuy nhien toc do dai phuc ha hang, dan ung huu canh cao dich phong ngu luc. Tai chien trang thuong huu co hoi su xuat uy luc kinh nhan dich “Trong dap�?cong kich, nang cu vo thi phong ngu, truc tiep sat tu dien tien dich binh.
String = 13517,Nhan gia, dac thu binh chung, thi uy quoc dich dac thu binh chung, kha di can chien, da kha di tien hanh trung cu ly cong kich, dac thu dich “An than�?nang luc, su dich quan hoan toan vo phap chuong ac hanh tung.
String = 13518,Tu hon cung binh, cung binh loai. Lai tu dia phu, sat tu nhat dich phuong dan vi huu co hoi bien vi thi binh.
String = 13519,No xa thi phi thuong thieu kien dich binh chung, kha di tien hanh sieu truong cu ly dich vien trinh cong kich, tuy nhien cong kich gian cach tuong duong truong, dan xa trinh thi so huu vien trinh binh chung trung toi vien dich. Nhuoc huu nga phuong si binh tro dang tai tien, no xa tien vo phap xa kich, hoan huu co hoi phat xuat cuong luc dich “Xuyen nham tien”， nang cu quan xuyen toi da ngu danh dich quan.
String = 13520,Thuan bo binh, bo binh loai, khac nhat thiet vien trinh binh, thuong binh, bi ky binh khac. Thi trang bi tinh luong, trung phong ham tran, tac chien dung manh dich binh chung, huu thoi nang quan xuyen ngu danh dich quan.
String = 13521,Dac thu binh chung, tieu tam kiem binh loai trung kich. Cong kich gian cach ngan truong, kha di tien hanh vien trinh dich phao xa cong kich, dong thoi huu co hoi phat xa dac thu dich “Viem dan”， bat can uy luc cuong dai, lac dia hau hoan nang san sinh hoa diem, tri tuc thieu thuong dich quan.
String = 13522,Boi ngoi quan, ky binh loai, thi nhac gia quan dich tinh anh bo doi, cong phong kiem bi dich thieu huu binh chung, huu co hoi thi trien “Trung chang�?tuyet chieu, dong thoi sat thuong tien phuong toi da luc danh dich quan, dan thuy thuong dien doi thuy quan tac tat ton that tham trong.
String = 13523,Nghia quan, bo binh loai. Tuy loai tu bo binh dich binh chung, bat qua nang luc luoc vi thien nhuoc, nghia quan toi dai dich uu the tai vu nang cu khac che thi binh chi loai dich dac thu binh chung, hoa loi dung dich phuong thi the trieu hoan thi binh dac tinh.
String = 13524,Thanh chau binh, bo binh loai. Thi hoang can binh hang tao hau dich dich thang cap binh chung, thang cap hau ung huu giac cao dich menh trung suat. Tai chien trang thuong huu co hoi su xuat khung pho dich “Huyet nhan”， hap thu dich quan sinh menh vi ky dung.
